import deudores from "./deudores";

const LineaDeudores = () => {
    return (
        <>
            <tbody>
                {deudores.map((user) => (
                    <tr>
                        <th scope="row">{user["#"]}</th>
                        <td>{user.nombre}</td>
                        <td>{user.ventas_realizadas}</td>
                        <td>{user.cantidad}</td>
                        <td>{user.descripcion_productos}</td>
                        <td>{user.tot_prod}</td>
                        <td>{user.tot_gen}</td>

                    </tr>
                ))}
            </tbody>
        </>
    );
};

export default LineaDeudores;
